import React from 'react';
import { Switch, Route } from 'react-router-dom';
import NavBar from './components/navBar';
import Vinland from './Page/Vinland';
import Miror from './Page/Miror';
import DemonSlayer from './Page/DemonSlayer';
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <NavBar />
        <Switch>
          <Route path="/vinland">
            <Vinland />
          </Route>
          <Route path="/miror">
            <Miror />
          </Route>
          <Route path="/demonSlayer">
            <DemonSlayer />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
